import React from 'react';
import '../styles/lighting.css';

function Lighting() {
  return (
    <div className='audio'>
        <div className='audio-title'>Lighting</div>
        <div className='audio-content'>
            <div className='audio-no'>32</div>
            <div className='audio-status'>ON</div>
            <div className='audio-collection'>
            <div className='audio-total'>Total</div>
            <div className='audio-total-no'>43</div>
            </div>
           
        </div>
    </div>
  )
}

export default Lighting
